import React from "react";
import { Card } from "./card/Card";
import { Button } from "../../components/button";
import "../../Shared.css";

const Dashboard = () => {
  return (
    <div className="d-flex justify-content-center align-items-center h-100 flex-column">
      <Card />
      <div className="heading__primary mt-2 text-white">Carly Rae Jepsen</div>
      <div className="heading__secondary m-3 text-center">
        Cut To The Feeling
      </div>
      <div>
        <video controls autoplay name="media">
          <source
            src="https://p.scdn.co/mp3-preview/229bb6a4c7011158cc7e1aff11957e274dc05e84?cid=774b29d4f13844c495f206cafdad9c86"
            type="audio/mpeg"
          />
        </video>
      </div>
      <Button
        type={"primary"}
        title={"Add to playlist"}
        action={() => {}}
        fill={"rgb(255, 78, 80)"}
      />
    </div>
  );
};

export default Dashboard;
